import React, { useEffect } from 'react';
import Chart from 'chart.js/auto'; // Import Chart.js library
import Header from '../components/header'; // Import Header component
import Footer from '../components/footer'; // Import Footer component

const Home = () => {
  // Define cleanupCharts function
  const cleanupCharts = () => {
    if (window.ordersChart instanceof Chart) {
      window.ordersChart.destroy();
    }
    if (window.customersChart instanceof Chart) {
      window.customersChart.destroy();
    }
    if (window.laundryChart instanceof Chart) {
      window.laundryChart.destroy();
    }
  };

  useEffect(() => {
    // Assume you have fetched data from the server
    const metricsData = {
      ordersToday: 25,
      ordersThisWeek: [30, 40, 45, 50, 55, 60, 65], // Example data for 7 days
      newCustomers: 10,
      unclaimedLaundry: 5,
      claimedLaundry: 15
    };

    // Define custom color palette
    const colorPalette = ['#0B0C10', '#1F2833', '#C5C6C7', '#66FCF1'];

    // Call cleanup function before creating new charts
    cleanupCharts();

    // Orders chart
    const ordersChartCtx = document.getElementById('ordersChart').getContext('2d');
    window.ordersChart = new Chart(ordersChartCtx, {
      type: 'bar',
      data: {
        labels: ['Today', 'This Week'],
        datasets: [{
          label: 'Number of Orders',
          data: [metricsData.ordersToday, metricsData.ordersThisWeek.reduce((a, b) => a + b, 0)],
          backgroundColor: colorPalette[0],
          borderColor: colorPalette[1]
        }]
      }
    });

    // Customers chart
    const customersChartCtx = document.getElementById('customersChart').getContext('2d');
    window.customersChart = new Chart(customersChartCtx, {
      type: 'pie',
      data: {
        labels: ['New Customers', 'Returning Customers'],
        datasets: [{
          label: 'Customer Distribution',
          data: [metricsData.newCustomers, 100 - metricsData.newCustomers],
          backgroundColor: [colorPalette[0], colorPalette[2]]
        }]
      }
    });

    // Laundry chart
    const laundryChartCtx = document.getElementById('laundryChart').getContext('2d');
    window.laundryChart = new Chart(laundryChartCtx, {
      type: 'doughnut',
      data: {
        labels: ['Unclaimed', 'Claimed'],
        datasets: [{
          label: 'Laundry Status',
          data: [metricsData.unclaimedLaundry, metricsData.claimedLaundry],
          backgroundColor: [colorPalette[0], colorPalette[2]]
        }]
      }
    });

    // Clean up charts when component unmounts
    return () => {
      cleanupCharts();
    };
  }, []);

  return (
    <div>
      <Header /> {/* Include Header component */}
      <div>
        <div className="jumbotron text-center">
          <br/><br/>
          <h1>Welcome to Our Website</h1>
          <p>We provide top-notch laundry services</p>
          <a href="/order/new" className="btn btn-primary btn-lg">Place an Order</a>
        </div>
    
        <div className="container">
        <br />
        <br />
        <br />
          <div className="row">
            <div className="col-md-6"> {/* Added Bootstrap grid system to fit two charts per row */}
              <div className="chart-container">
                <h2 className="text-center">Orders Overview</h2>
                <canvas id="ordersChart"></canvas>
              </div>
            </div>
            <div className="col-md-6"> {/* Added Bootstrap grid system to fit two charts per row */}
              <div className="chart-container">
                <h2 className="text-center">Customers Overview</h2>
                <canvas id="customersChart"></canvas>
              </div>
            </div>
          </div>
          <div className="row">
            <div className="col-md-6"> {/* Added Bootstrap grid system to fit two charts per row */}
              <div className="chart-container">
                <h2 className="text-center">Laundry Overview</h2>
                <canvas id="laundryChart"></canvas>
                <br />
                <br />
                <br />
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer /> {/* Include Footer component */}
    </div>
  );
};

export default Home;
